'''Jorzik''' is a dwarf that works in the [[Blast Furnace]] in eastern [[Keldagrim]]. He runs the [[Armour store.]], which sells armour from [[mithril armour|mithril]] to [[rune armour|runite]] that players have made at the Blast Furnace. One can smith at the [[anvil]]s next to him.{{clear|left}}

